function fieldFormat(num) {
  // 将数字转换为字符串
  const str = num.toFixed(2).toString();
  // 分离整数部分和小数部分
  const parts = str.split('.');
  // 整数部分加千分位逗号
  parts[0] = parts[0].replace(/\B(?=(\d{3})+(?!\d))/g, ',');
  // 返回格式化后的结果
  return parts.join('.');
}
